import React from 'react';

const Contacto = () => {
    return (
        <form>
            <legend> Formulario de Contacto</legend>

            <div className="input-field">
                <label> Nombre: </label>
                <input type="text" placeholder="Tu nombre"/>
            </div>

            <div className="input-field">
                <label> Email: </label>
                <input type="email" placeholder="Tu email"/>
            </div>

        </form>
    );
};

export default Contacto;
